const response = await fetch('https://yourapi.com/whole-lotta-records');
const data = await response.json();

const pageSize = 25;
const page = 1;
const pages = Math.ceil(data.length / pageSize);

const pageData = data.slice((page * pageSize) - pageSize, page * pageSize);
